import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { isAuthenticated } from "../auth";
import { getUserOrders } from "../user";

const Orders = () => {
  const { userId } = useParams();

  const [orders, setOrders] = useState();

  const { user, token } = isAuthenticated();

  const getUserOrderDetails = async (userId, token) => {
    try {
      const  data  = await getUserOrders(userId, token);
      if (data.error) {
        return console.log(data.error);
      } else {
        console.log("Data", data);
        return setOrders(data);
      }
    } catch (error) {}
  };

  useEffect(() => {
    getUserOrderDetails(userId, token);
  }, []);

  return (
    <section className="userBoard-right-section accounts-section">
      <h1 className="userBoard-right-header">Orders</h1>
      <div className="userBoard-right-subSec">
        <div className="userBoard-right-customer-order-table">
          <div className="userBoard-right-customer-order-table-head-sec">
            <div className="userBoard-right-customer-order-table-head-value">Products</div>
            <div className="userBoard-right-customer-order-table-head-value">Order ID</div>
            <div className="userBoard-right-customer-order-table-head-value">Status</div>
            <div className="userBoard-right-customer-order-table-head-value">Total</div>
            <div className="userBoard-right-customer-order-table-head-value">Payment Mode</div>
            <div className="userBoard-right-customer-order-table-head-value">Delivery Boy</div>
            <div className="userBoard-right-customer-order-table-head-value">Action</div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Orders;
